import React, { Component } from 'react';
import CaculateBtn from './CaculateBtn'

class Caculator extends Component {
  constructor(props) {
    super(props)
    this.state = {}
  }

  render() {
    return ( 
      <div>
        <CaculateBtn></CaculateBtn>
      </div> 
      )
  }
}

export default Caculator;
